import { BrowserRouter as Routes , Switch, Route, Link } from "react-router-dom";
import Home from "./pages/Home"
import Login from "./pages/Login"

function App() {
  return (
    <Router>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/Login">Login</Link>
        </li>
      </ul>

    </Router>
  );
}

export default App;
